// src/components/WorkCard.jsx
import React from "react";
import { ClipboardCheck, FolderKanban, FileText, CalendarDays } from "lucide-react";

function WorkCard() {
  const items = [
    { name: "Tasks", icon: <ClipboardCheck className="w-5 h-5 text-blue-500" /> },
    { name: "Projects", icon: <FolderKanban className="w-5 h-5 text-green-500" /> },
    { name: "Reports", icon: <FileText className="w-5 h-5 text-red-500" /> },
    { name: "Meetings", icon: <CalendarDays className="w-5 h-5 text-purple-500" /> },
  ];

  return (
    <div className="bg-white shadow-md rounded-2xl p-6 border border-gray-200">
      <h2 className="text-xl font-semibold mb-4 tracking-wide">Work</h2>
      <ul className="space-y-3">
        {items.map((item, index) => (
          <li key={index} className="flex items-center gap-3 text-gray-700">
            {item.icon}
            <span className="text-sm font-medium">{item.name}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default WorkCard;
